-- ----------------------------
-- Procedure structure for `generate_coal_mines_data`
-- ----------------------------
DROP PROCEDURE IF EXISTS `generate_coal_mines_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_coal_mines_data`()
BEGIN
    DECLARE i INT DEFAULT 1;
    DECLARE total INT DEFAULT 600;
    DECLARE province_flag INT;
    DECLARE city_val VARCHAR(50);
    DECLARE province_val VARCHAR(50);
    DECLARE prefix_val VARCHAR(20); -- 煤矿名称前缀
    DECLARE mine_name_suffix VARCHAR(20); -- 煤矿名称后缀（城市/区域简称）
    
    -- 临时表存城市
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_cities (
        city_name VARCHAR(50)
    );
    -- 临时表存名称前缀
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_prefixes (
        prefix VARCHAR(20)
    );
    
    -- 拆分前缀到临时表
    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@mine_prefixes, ',', numbers.n), ',', -1)
    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14 UNION ALL SELECT 15
          UNION ALL SELECT 16 UNION ALL SELECT 17 UNION ALL SELECT 18 UNION ALL SELECT 19 UNION ALL SELECT 20) numbers
    WHERE n <= (LENGTH(@mine_prefixes) - LENGTH(REPLACE(@mine_prefixes, ',', '')) + 1);
    
    WHILE i <= total DO
        SET province_flag = FLOOR(RAND() * 100);
        DELETE FROM temp_cities;
        
        -- 70% 概率分配到目标省份（晋、陕、豫、鲁、蒙 + 新增河北、辽宁、黑龙江、江苏、安徽）
        IF province_flag < 70 THEN
            CASE FLOOR(RAND() * 10)
                WHEN 0 THEN
                    SET province_val = '山西省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@shanxi_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11) numbers
                    WHERE n <= (LENGTH(@shanxi_cities) - LENGTH(REPLACE(@shanxi_cities, ',', '')) + 1);
                WHEN 1 THEN
                    SET province_val = '陕西省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@shaanxi_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11) numbers
                    WHERE n <= (LENGTH(@shaanxi_cities) - LENGTH(REPLACE(@shaanxi_cities, ',', '')) + 1);
                WHEN 2 THEN
                    SET province_val = '河南省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@henan_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14 UNION ALL SELECT 15
                          UNION ALL SELECT 16 UNION ALL SELECT 17) numbers
                    WHERE n <= (LENGTH(@henan_cities) - LENGTH(REPLACE(@henan_cities, ',', '')) + 1);
                WHEN 3 THEN
                    SET province_val = '山东省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@shandong_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14 UNION ALL SELECT 15
                          UNION ALL SELECT 16) numbers
                    WHERE n <= (LENGTH(@shandong_cities) - LENGTH(REPLACE(@shandong_cities, ',', '')) + 1);
                WHEN 4 THEN
                    SET province_val = '内蒙古自治区';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@neimenggu_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12) numbers
                    WHERE n <= (LENGTH(@neimenggu_cities) - LENGTH(REPLACE(@neimenggu_cities, ',', '')) + 1);
                WHEN 5 THEN
                    SET province_val = '河北省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@hebei_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11) numbers
                    WHERE n <= (LENGTH(@hebei_cities) - LENGTH(REPLACE(@hebei_cities, ',', '')) + 1);
                WHEN 6 THEN
                    SET province_val = '辽宁省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@liaoning_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14) numbers
                    WHERE n <= (LENGTH(@liaoning_cities) - LENGTH(REPLACE(@liaoning_cities, ',', '')) + 1);
                WHEN 7 THEN
                    SET province_val = '黑龙江省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@heilongjiang_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13) numbers
                    WHERE n <= (LENGTH(@heilongjiang_cities) - LENGTH(REPLACE(@heilongjiang_cities, ',', '')) + 1);
                WHEN 8 THEN
                    SET province_val = '江苏省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@jiangsu_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13) numbers
                    WHERE n <= (LENGTH(@jiangsu_cities) - LENGTH(REPLACE(@jiangsu_cities, ',', '')) + 1);
                WHEN 9 THEN
                    SET province_val = '安徽省';
                    SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@anhui_cities, ',', numbers.n), ',', -1)
                    FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                          UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                          UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14 UNION ALL SELECT 15
                          UNION ALL SELECT 16 UNION ALL SELECT 17 UNION ALL SELECT 18) numbers
                    WHERE n <= (LENGTH(@anhui_cities) - LENGTH(REPLACE(@anhui_cities, ',', '')) + 1);
            END CASE;
            
            -- 选名称前缀 + 城市简称 + 矿 组合成煤矿名
            SET prefix_val = (SELECT prefix FROM temp_prefixes ORDER BY RAND() LIMIT 1);
            SET mine_name_suffix = SUBSTRING(city_val, 1, 1); -- 取城市首字
            -- 处理特殊情况（例如3字以上城市名）
            IF LENGTH(city_val) > 3 THEN
                SET mine_name_suffix = CONCAT(SUBSTRING(city_val, 1, 2), '矿'); -- 取前两字
            ELSE
                SET mine_name_suffix = CONCAT(mine_name_suffix, '矿');
            END IF;
            SET @mine_name = CONCAT(prefix_val, mine_name_suffix);
            
            -- 随机选城市
            SET city_val = (SELECT city_name FROM temp_cities ORDER BY RAND() LIMIT 1);
        ELSE
            -- 30% 其他省份
            CASE FLOOR(RAND() * 13)
                WHEN 0 THEN SET province_val = '北京市'; SET @city_list = @beijing_cities;
                WHEN 1 THEN SET province_val = '天津市'; SET @city_list = @tianjin_cities;
                WHEN 2 THEN SET province_val = '上海市'; SET @city_list = @shanghai_cities;
                WHEN 3 THEN SET province_val = '重庆市'; SET @city_list = @chongqing_cities;
                WHEN 4 THEN SET province_val = '浙江省'; SET @city_list = @zhejiang_cities;
                WHEN 5 THEN SET province_val = '福建省'; SET @city_list = @fujian_cities;
                WHEN 6 THEN SET province_val = '江西省'; SET @city_list = @jiangxi_cities;
                WHEN 7 THEN SET province_val = '湖北省'; SET @city_list = @hubei_cities;
                WHEN 8 THEN SET province_val = '湖南省'; SET @city_list = @hunan_cities;
                WHEN 9 THEN SET province_val = '广东省'; SET @city_list = @guangdong_cities;
                WHEN 10 THEN SET province_val = '海南省'; SET @city_list = @hainan_cities;
                WHEN 11 THEN SET province_val = '四川省'; SET @city_list = @sichuan_cities;
                WHEN 12 THEN SET province_val = '贵州省'; SET @city_list = @guizhou_cities;
                WHEN 13 THEN SET province_val = '云南省'; SET @city_list = @yunnan_cities;
                WHEN 14 THEN SET province_val = '广西壮族自治区'; SET @city_list = @guangxi_cities;
                WHEN 15 THEN SET province_val = '甘肃省'; SET @city_list = @gansu_cities;
                WHEN 16 THEN SET province_val = '青海省'; SET @city_list = @qinghai_cities;
                WHEN 17 THEN SET province_val = '宁夏回族自治区'; SET @city_list = @ningxia_cities;
                WHEN 18 THEN SET province_val = '新疆维吾尔自治区'; SET @city_list = @xinjiang_cities;
                WHEN 19 THEN SET province_val = '台湾省'; SET @city_list = @taiwan_cities;
                WHEN 20 THEN SET province_val = '香港特别行政区'; SET @city_list = @hongkong_cities;
                WHEN 21 THEN SET province_val = '澳门特别行政区'; SET @city_list = @macau_cities;
            END CASE;
            
            -- 填充城市到临时表
            SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(@city_list, ',', numbers.n), ',', -1)
            FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5
                  UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10
                  UNION ALL SELECT 11 UNION ALL SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14 UNION ALL SELECT 15
                  UNION ALL SELECT 16 UNION ALL SELECT 17 UNION ALL SELECT 18 UNION ALL SELECT 19 UNION ALL SELECT 20) numbers
            WHERE n <= (LENGTH(@city_list) - LENGTH(REPLACE(@city_list, ',', '')) + 1);
            
            -- 随机选城市
            SET city_val = (SELECT city_name FROM temp_cities ORDER BY RAND() LIMIT 1);
            
            -- 简单命名：省份首字 + 随机前缀 + 矿
            SET prefix_val = (SELECT prefix FROM temp_prefixes ORDER BY RAND() LIMIT 1);
            SET @mine_name = CONCAT(SUBSTRING(province_val,1,1), prefix_val, '矿');
        END IF;
        
        -- 插入数据
        VALUES (@mine_name, province_val, FLOOR(RAND() * 10000000 + 5000000), 
                CONCAT('联系人_', LPAD(i, 3, '0')),
                CONCAT('138', LPAD(FLOOR(RAND() * 10000000), 7, '0')),
                province_val, city_val);
        
        SET i = i + 1;
    END WHILE;
    
    -- 删除临时表
    DROP TEMPORARY TABLE IF EXISTS temp_cities;
    DROP TEMPORARY TABLE IF EXISTS temp_prefixes;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `split_str`
-- ----------------------------
DROP FUNCTION IF EXISTS `split_str`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `split_str`(str VARCHAR(255), delim VARCHAR(1), pos INT) RETURNS varchar(255) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
    DECLARE output VARCHAR(255);
    SET output = REPLACE(SUBSTRING(SUBSTRING_INDEX(str, delim, pos), LENGTH(SUBSTRING_INDEX(str, delim, pos - 1)) + 1), delim, '');
    RETURN output;
END
;;
DELIMITER ;
